window.bookSummaryJSON = "<p>Christine is an actress, a breakout star in truth. She never believed in wizards. She never knew of the darkest wizard ever to have existed: Mortem. But Mortem knows of her. Christine is the sole survivor of his assassination of two wizarding journalists that resulted in a destroyed cafe and many dead civilians. Fearful her rising celebrity will bring his great plan to take over the wizarding world into the consciousness of the public, he seeks her out, and Christine is forced on the run. </p>"; 
